evidence.value:
position: relative;
display: flex;
flex-direction: column;
justify-content: center;
align-items: center;
margin: 4px;
padding: 20px;

position: absolute;
display: flex;
justify-content: center;
align-items: center;
width: 24px;
height: 24px;
right: 0;
top: 0;
padding: 0;
background: transparent;
border: 0;
border-radius: 50%;
cursor: pointer;

img {
  flex-shrink: 0;
}

display: flex;
justify-content: center;
align-items: center;
padding: 8px 20px;
background-color: #4E8Cf9;
border: 0;
border-radius: 18px;
box-shadow: 0 2px 8px 0 rgba(0, 0, 0, 0.08);
font-weight: 500;
font-size: 12px;
line-height: 1.67;
color: #FFF;
text-align: center;
cursor: pointer;

&:focus {
  outline: none;
}
